/* Create table to link sample types with sample sources */
DROP sequence IF EXISTS clinlims.sample_type_source_seq;
DROP TABLE IF EXISTS clinlims.sampletype_source;
CREATE SEQUENCE clinlims.sample_type_source_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;
CREATE TABLE clinlims.sampletype_source (
    id numeric(10,0) NOT NULL,
    sample_type_id numeric(10,0) NOT NULL,
    source_id numeric(10,0) NOT NULL
);
ALTER TABLE clinlims.sampletype_source
    ADD CONSTRAINT sampletype_source_pkey PRIMARY KEY (id);
ALTER TABLE clinlims.sampletype_source
    ADD CONSTRAINT sampletype_source_sample_type_id_fkey FOREIGN KEY (sample_type_id) REFERENCES type_of_sample(id) MATCH FULL;
ALTER TABLE clinlims.sampletype_source
    ADD CONSTRAINT sampletype_source_source_id_fkey FOREIGN KEY (source_id) REFERENCES source_of_sample(id) MATCH FULL;
